    main {
        width: 1366px;
        height: 100vh;
        margin: 0 auto;
        position: relative;
    }

    .container {
        display: flex;
    }

    .wrapper {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
    }

    h1,
    p {
        margin: 0;
        padding: 0;
    }

    h1 {
        font-family: 'Roboto', sans-serif;
        font-weight: 700;
        font-size: 60px;
        border-bottom: 4px solid #67a085;
        margin-bottom: 80px;
        padding-bottom: 50px;
        text-align: center;
        color: #2b2b2b;
    }

    p {
        font-family: 'Roboto', sans-serif;
        font-size: 24px;
        font-weight: 400;
        text-align: center;
        color: #2b2b2b;
    }

    .container {
        width: 650px;
        height: 650px;
        background-color: #fff;
        padding: 160px 80px 0 80px;
        -webkit-box-shadow: 0px 0px 24px 1px rgba(0, 0, 0, 0.62);
        -moz-box-shadow: 0px 0px 24px 1px rgba(0, 0, 0, 0.62);
        box-shadow: 0px 0px 24px 1px rgba(0, 0, 0, 0.62);
    }

    .operator-box {
        width: 530px;
        position: absolute;
        z-index: 90;
        bottom: 0;
        right: 0px;
    }

    .operator-box img {
        width: 100%;
    }
    .main-box {
        z-index: 91;
        position: relative;
    }
    /*Iphone 5*/
